import React ,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar, NavbarBrand, NavbarToggler,NavItem, Dropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';
import { useHistory } from "react-router-dom";

import { NavLink } from 'react-router-dom';
import './navi.css';


const handleLogOut = history => () => {
    history.push('/log');
};

const Navi = ({history}) => {
        return(
            <div>
                <Navbar className="fixed-top" dark expand="md">
                    <div className="container-fluid">
                        <NavbarToggler />
                        <NavbarBrand className="mr-auto" href="/"><h3>Wallet as a Service</h3></NavbarBrand>

                            <Nav navbar className="ml-auto">
                                <NavItem>
                                    <NavLink className="nav-link"  to='/home'><span className="fa fa-home fa-lg"></span> Home</NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink className="nav-link" to='/home'><span className="fa fa-user fa-lg"></span>User</NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink className="nav-link" onClick={handleLogOut(history)} ><span className="fa fa-sign-out fa-lg"></span> Log Out</NavLink>
                                </NavItem>
                            </Nav>
                    </div>
                </Navbar>

            </div>
        );

}

export default Navi;

